import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div>
      <nav className="h-8 bg-slate-400">
        <Link >Home</Link>
        <Link >Statistics</Link>
        <Link >Blog</Link>
      </nav>
    </div>
  );
};

export default NavBar;
